import Link from "next/link";

interface Props {
  game?: Game;
}

export default function Game(props: Props) {
  const { game } = props;
  const id = game && game.id;
  const shareId = id.slice(0, 4);

  return <main>{game && <div>Join with: {shareId}</div>}</main>;
}
